import {CollectionCardBox,} from "./CollectionCard.styled"

export const CollectionCard = ({image,header,text }) => {
    return (
<CollectionCardBox>
    <div>
        <img src={image} alt={header}></img>
    </div>
    <h3>{header}</h3>
    <p>{text}</p>
</CollectionCardBox>
    );
  };
